	<script type="text/javascript">
function processSelect() {
	// clear the old group name
	$("#nameconnection").val('');
	
	$value = $("#existingconnection").val();
	
	if ($value == '-1') {
		$("#groupname").show();
	} else {
		$("#groupname").hide();
	}
}

var accuracy_limit = 16093;
var pending_limit = 0;
function goMyLocation(loc) {
	if (loc.address) {
		var zip = loc.address.postalCode;
	} else {
		var zip = '';
	}
	
	if (loc.coords.accuracy < accuracy_limit) {
		pending_limit = loc.coords.accuracy;
		$("#latitude").html('<span>Latitude:</span> ' + loc.coords.latitude + '</span>');
		$("#longitude").html('<span>Longitude:</span> ' + loc.coords.longitude + '</span>');
	
		// update google href
		$("#gmap").attr("href", 'http://maps.google.com/maps?z=17&q=loc:' + loc.coords.latitude + '+' +
	    	loc.coords.longitude);
		
		$.post("user-settings.php", 
		{ action: "refinelocation",
	      latitude: loc.coords.latitude, 
		  longitude: loc.coords.longitude,
		  accuracy: loc.coords.accuracy,
		  postal_code: zip },
	      refineLocHandler
	   );
	} else {
		$("#refine_loc_href").show();
	    $("#refine_loc_loading").hide();
	    $("#refine_loc_help").html("A more accurate location is not available at this time");
	}
}

function refineLocHandler(html) {
	var parameters = html.split('&');
	var msg = parameters[0].split('=')[1];
	var city = parameters[1].split('=')[1];
	var status = parameters[2].split('=')[1];
	
	if (status) {
		accuracy_limit = pending_limit;
		$("#connection_city").html(city);
	}
	$("#refine_loc_href").show();
    $("#refine_loc_loading").hide();
    $("#refine_loc_help").html(msg);
}

function errorHandler(err) {
	var msg = "Unable to refine location.  Try again later.";
	if (err.code == 1) {
		// user said no!
		msg = "Refine location was canceled.";
	} else if (err.code == 2) {
		// position unavailable
	} else if (err.code == 3) {
		// timeout
	} else {
		// unknown
	}
	
	$("#refine_loc_href").show();
    $("#refine_loc_loading").hide();
    $("#refine_loc_help").html(msg);
}

function getMyLocation() {
	if (navigator.geolocation) {
    
      $("#refine_loc_href").hide();
	  $("#refine_loc_why").hide();
		
      $("#refine_loc_loading").show();
	  $("#refine_loc_help").html('Please select "<span>Share Location</span>" from the top of your browser.');
      $("#refine_loc_help").show();
	
	  navigator.geolocation.getCurrentPosition(goMyLocation, errorHandler, {enableHighAccuracy: false, timeout: 5000, maximumAge: 10*60*1000});  // cache for 10 minutes
  } else {  // not supported by browser hide the refine location, should already be hidden
		$("#refine-location").hide();
  }
}

$(document).ready(function() {
  	// hide refine button if browser doesn't support it
	if (!navigator.geolocation) {
	  $("#refine-location").hide();	
	}
});

</script>

	
