<div id="modal-why-refine" class="modal-block">
	<h4>Why should I refine my location?</h4>
		<p>We use GeoIP data to identify your location based on your IP address. This is not always accurate though. By refining your location we reach out to other sources which can be much more accurate. We can't do so without your knowledge which is why you have to initiate the process.</p>
		<p>We respect your privacy and will never provide your location to a third-party.  The location data collected is only used to determine your best Ookla Speedtest server and in data aggregation at a postal code level.  This is completely anonymous and will not reveal your location.</p>
		<p><a href="http://www.mozilla.com/en-US/firefox/geolocation/" target="_blank">Additional information on browser Geolocation.</a></p>
</div><!--/modal-why-refine-->

